import "../css/TableSelect.css";

function Table_2seats () {
    return (
        <>
            <div className="row">
                    <div className="seat"/>
            </div>
            <div className="row">
                    <div className="seat"/>
            </div>  
            
        </>
    )
    
}


export default Table_2seats;
